import React from 'react'
import '../style/form.css'
import {  Grid, Paper,Card, CardMedia, CardContent, Typography } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';
import ReactSpeedometer from "react-d3-speedometer"



const useStyles = makeStyles((theme)=>({
    gridContainer: {
      paddingLeft: "20px",
      paddingRight: "20px",
      background:"#7555D9",
      minHeight:"100vh"
    },
    paper: {
        padding: theme.spacing(2),
        textAlign: 'center',
        color: theme.palette.text.secondary,
      },

  }));

function Score() {
const classes = useStyles();
return (
<>
<div className={classes.gridContainer}>
<Grid container>
<Grid item xs>

</Grid>
<Grid item xs={11} sm={6} md={6} lg={4} >

<div justify="center" className={classes.head}>
<h3 className="text1">2021 Friendship</h3>
<h3 className="text2">Dare</h3>
</div>
<Card className="form-card">
  <h3 className="how">Your Score: 12/15</h3>
  <ReactSpeedometer
    value={777}
    currentValueText="Happiness Level"
    customSegmentLabels={[
      {
        text: "Very Bad",
        position: "INSIDE",
        color: "#555",
      },
      {
        text: "Bad",
        position: "INSIDE",
        color: "#555",
      },
      {
        text: "Ok",
        position: "INSIDE",
        color: "#555",
        fontSize: "19px",
      },
      {
        text: "Good",
        position: "INSIDE",
        color: "#555",
      },
      {
        text: "Very Good",
        position: "INSIDE",
        color: "#555",
      },
    ]}
  />                    
</Card>

</Grid>
<Grid item xs>

</Grid>

</Grid>
<br/>
<Grid container>
<Grid item xs>

</Grid>
<Grid item xs={11} sm={6} md={6} lg={4}>

</Grid>
<Grid item xs>

</Grid>
</Grid>

</div>
</>
);
}

export default Score
